import React from 'react';

const Project = () => {
  return (
    <>
      <header>
        <h1>PROJECTS</h1>

      </header>
      <main>
        <section>
          <img src="avatar.jpg" alt="Avatar" />
          <p></p>
        </section>
      </main>
      <footer>
        <a href="#">GitHub</a>
        <a href="#">LinkedIn</a>
        <a href="#">Stack Overflow</a>
      </footer>
    </>
  );
};

export default Project;
